import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="pool1">
          <img source={require('./res/subject1.png')} />
        </div>
        <div className="pool2">
          <img source={require('./res/subject2.png')} />
        </div>
        <div className="pool3">
          <img source={require('./res/subject3.png')} />
        </div>
      </header>
    </div>
  );
}

export default App;
